import React from "react";
import 'bootstrap/dist/css/bootstrap.css';
import {Form,Button,Nav} from "react-bootstrap";

const Login  = ()=>{

    return(
        <>
       <div className="container container-fluid m-auto d-flex w-100 h-100 ">
      <form action="login" method="post">
      <div>

      <label Htmlfor="email">Email</label>
      <input type="text" placeholder="Email" required = "true"  name="email"/>
      </div>
      <div>
      <label Htmlfor="password">Password</label>
      <input type="password" placeholder="Password" required = "true"  name="password"/>
     
      </div>
      <input type="submit" className="bg-primary te" placeholder=""  value="Login"/>
      </form>
    </div>
<Nav.Link href="/register"> Create a new account</Nav.Link>
     
        </>
    )
}


export default Login;
